//app

function isbip38(key)
{
	key = key.toString();
	return (/^6P[123456789ABCDEFGHJKLMNPQRSTUVWXYZabcdefghijkmnopqrstuvwxyz]{56}$/.test(key));
}

function ispublickeyvalid(publickey)
{
   try {
    bitcoinjs.address.toOutputScript(publickey, bitcoinjs.networks.bitcoin)
    return true
  } catch (e) {
      console.log(e);
    return false
  }
}

function isprivatekeyvalid(wif)
{
    try
    {
      keypair = bitcoinjs.ECPair.fromWIF(wif, bitcoinjs.networks.bitcoin);
      
      if(keypair.compressed == false)
      {
        uncompressed_wif = wif;
        pub_standard = bitcoinjs.payments.p2pkh({ pubkey: keypair.publicKey, network: bitcoinjs.networks.bitcoin }).address;
          
        decoded_wif = bitcoinjs.wif.decode(wif);
        compressed_wif = bitcoinjs.wif.encode(128, decoded_wif.privateKey, true);

        keypair_compressed = bitcoinjs.ECPair.fromWIF(compressed_wif, bitcoinjs.networks.bitcoin);
        
        pub_standard_compressed = bitcoinjs.payments.p2pkh({ pubkey: keypair_compressed.publicKey, network: bitcoinjs.networks.bitcoin }).address;
        pub_segwit = bitcoinjs.payments.p2wpkh({ pubkey: keypair_compressed.publicKey, network: bitcoinjs.networks.bitcoin }).address;
        pub_p2sh = bitcoinjs.payments.p2sh({  redeem: bitcoinjs.payments.p2wpkh({ pubkey: keypair_compressed.publicKey, network: bitcoinjs.networks.bitcoin }) }).address;
      }
      else
      {
        compressed_wif = wif;
        pub_standard_compressed = bitcoinjs.payments.p2pkh({ pubkey: keypair.publicKey, network: bitcoinjs.networks.bitcoin }).address;
        pub_segwit = bitcoinjs.payments.p2wpkh({ pubkey: keypair.publicKey, network: bitcoinjs.networks.bitcoin }).address;
        pub_p2sh = bitcoinjs.payments.p2sh({  redeem: bitcoinjs.payments.p2wpkh({ pubkey: keypair.publicKey, network: bitcoinjs.networks.bitcoin }) }).address;
          
        decoded_wif = bitcoinjs.wif.decode(wif);
        uncompressed_wif = bitcoinjs.wif.encode(128, decoded_wif.privateKey, false);

        keypair_uncompressed = bitcoinjs.ECPair.fromWIF(uncompressed_wif, bitcoinjs.networks.bitcoin);
        
        pub_standard = bitcoinjs.payments.p2pkh({ pubkey: keypair_uncompressed.publicKey, network: bitcoinjs.networks.bitcoin }).address;
      }
      
      return [true, uncompressed_wif, pub_standard, pub_segwit, pub_p2sh, pub_standard_compressed, compressed_wif];
 
    }
    catch(e)
    {
      console.log(e);
    }
    return [false, '', '', '', ''];
}

function bitamp_verifylogin_create()
{
    login_seed = $('#create-wallet-your-seed');
    confirm_seed = $('#create-wallet-confirm-your-seed');
 
    val_seed = login_seed.val().trim();
    confirm_seed = confirm_seed.val().trim();
    
    if(confirm_seed != val_seed)
    {
        $('#seed-confirm-error').show();
        return false;
    }
    
    if(confirm_seed != '')
    {
        create_start_loading();
        mnemonic_to_seed(confirm_seed).then(valid =>
        {
            if(valid)
            {
                account_seed = confirm_seed;
                account_session_id = temp_account_session_id;
                signin_auth();
            }
            else
            {
                create_stop_loading();
                $('#seed-confirm-error').show();
            }
        });
    }
    
    return false;
}

function bitamp_verifylogin()
{
    if(login_is_loading == 1 || login_is_loading == 2)
    {
        return false;
    }
    login_start_loading();
    login_seed = $('#login-your-seed');
    login_private_key = $('#login-private-key');
    privatekey_pass = $('#password-private-key');
    
    val_seed = login_seed.val().trim();
    val_pkey = login_private_key.val().trim();
    val_pkey_pass = privatekey_pass.val();
    
    if(val_seed != '')
    {
        mnemonic_to_seed(val_seed).then(valid =>
        {
            if(valid)
            {
                account_seed = val_seed;
                account_session_id = temp_account_session_id;
                signin_auth();
            }
            else
            {
                login_stop_loading();
                $('#seed-login-error').show();
            }
        });
    }
    else if(val_pkey != '')
    {
        if(isbip38(val_pkey))
        {
            if(val_pkey_pass == '')
            {
                $('#bip38-login-error').show();
                return false;
            }
            
            try
            {
                
                Promise.resolve(bitcoinjs.bip38.decrypt(val_pkey, val_pkey_pass)).then(decrypted_key =>
                {
                    try
                    {
                        wif = bitcoinjs.wif.encode(0x80, decrypted_key.privateKey, decrypted_key.compressed);
                        
                        pkey_info = isprivatekeyvalid(wif);
                        if(pkey_info[0] == true)
                        {
                            account_single_private = pkey_info[1];
                            account_single_private_compressed = pkey_info[6];
                            
                            account_single_public_standard = pkey_info[2];
                            account_address_type[account_single_public_standard] = 0;
                            
                            account_keys_new.push({"private": account_single_private, "public": account_single_public_standard});
                            
                            account_single_public_standard_compressed = pkey_info[5];
                            account_address_type[account_single_public_standard_compressed] = 0;
                            
                            account_keys_new.push({"private": account_single_private_compressed, "public": account_single_public_standard_compressed});
                            
                            account_single_public_segwit = pkey_info[3];
                            account_address_type[account_single_public_segwit] = 1;
                            
                            account_keys_new.push({"private": account_single_private_compressed, "public": account_single_public_segwit});
                            
                            account_single_public_p2sh = pkey_info[4];
                            account_address_type[account_single_public_p2sh] = 2;
                            
                            account_keys_new.push({"private": account_single_private_compressed, "public": account_single_public_p2sh});
                            
                            temp_account_session_id = account_single_public_standard + ":" + account_single_public_segwit + ":" + account_single_public_p2sh;

                            account_session_id = temp_account_session_id;
                            
                            signin_auth();
                        }
                        else
                        {
                            login_stop_loading();
                            $('#pkey-login-error').show();
                        }
                        
                    }
                    catch(e)
                    {
                       login_stop_loading();
                       $('#pkey-login-error').show();
                    }
                })
                .catch(function(error)
                {
                    login_stop_loading();
                    $('#bip38-login-error').show();
                });
            
            }
            catch(e)
            {
               login_stop_loading();
               $('#bip38-login-error').show();
            }
            
            return false;
        }
        pkey_info = isprivatekeyvalid(val_pkey);
        if(pkey_info[0] == true)
        {
            account_single_private = pkey_info[1];
            account_single_private_compressed = pkey_info[6];
            
            account_single_public_standard = pkey_info[2];
            account_address_type[account_single_public_standard] = 0;
            
            account_keys_new.push({"private": account_single_private, "public": account_single_public_standard});
            
            account_single_public_standard_compressed = pkey_info[5];
            account_address_type[account_single_public_standard_compressed] = 0;
            
            account_keys_new.push({"private": account_single_private_compressed, "public": account_single_public_standard_compressed});
            
            account_single_public_segwit = pkey_info[3];
            account_address_type[account_single_public_segwit] = 1;
            
            account_keys_new.push({"private": account_single_private_compressed, "public": account_single_public_segwit});
            
            account_single_public_p2sh = pkey_info[4];
            account_address_type[account_single_public_p2sh] = 2;
            
            account_keys_new.push({"private": account_single_private_compressed, "public": account_single_public_p2sh});
            
            temp_account_session_id = account_single_public_standard + ":" + account_single_public_segwit + ":" + account_single_public_p2sh;

            account_session_id = temp_account_session_id;
            
            signin_auth();
        }
        else
        {
            login_stop_loading();
            $('#pkey-login-error').show();
        }
    }
    else
    {
        login_stop_loading();
    }
    
    return false;
}

function signin_auth()
{
    $.ajax({
        type: "POST",
        url: '/auth.php',
        data: {
        session_id: account_session_id
       }
    }).done(function(returned_data)
    {
            if(Object.keys(returned_data).length > 0)
            {
                if(returned_data["result"] == 1)
                {
                    create_stop_loading();
                    login_stop_loading();
                    window.location.hash = "#/account.html";
                }
                else
                {
                    account_session_id = null;
                    create_stop_loading();
                    login_stop_loading();
                    alert("Failed to sign in. Please try again later...");
                }                    
            }
            else
            {
                account_session_id = null;
                create_stop_loading();
                login_stop_loading();
                alert("Failed to sign in. Please try again later...");
            }
    }).fail(function()
    {
        account_session_id = null;
        create_stop_loading();
        login_stop_loading();
        alert("Failed to sign in. Please try again later...");
    });
}

function bitamp_pkey_checkbip38()
{
    $('#pkey-login-error').hide();
    $('#bip38-login-error').hide();
    login_private_key = $('#login-private-key');
    val_pkey = login_private_key.val().trim();
    option_private_key = $('#login-option-private-key');
    password_private_key = $('#password-private-key');
    
    if(isbip38(val_pkey))
    {
        password_private_key.closest('.form__label').removeClass('hide');
    }
    else
    {
        password_private_key.closest('.form__label').addClass('hide');
    }
}
